import React from "react";
import styled from "styled-components";
import head from "../canes.png";

export default function Header() {
  return (
    <section
      className="w-full bg-cover bg-center"
      style={
        ({ backgroundImage: "url(" + head + ")", height: 32 + "rem" },
        { height: 32 + "rem" })
      }
    ></section>
  );
}
